import { Box, Button, Chip, Divider, Grid, InputLabel, makeStyles, MenuItem, Select, Typography } from '@material-ui/core'
import React from 'react'

export interface NoteItemProps {}

const useStyles = makeStyles((theme) => ({
  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
  chip: {
    margin: theme.spacing(0.5),
  },
  section1: {
    margin: theme.spacing(3, 2),
  },
  section2: {
    margin: theme.spacing(2),
  },
  section3: {
    margin: theme.spacing(3, 1, 1),
  },
}))

export default function NoteItem(props: NoteItemProps) {
  const classes = useStyles()
  const [status, setStatus] = React.useState('');

  const handleChangeSelect = (event: React.ChangeEvent<{ value: unknown }>) => {
    setStatus(event.target.value as string);
  };
  return (
    <Box className={classes.root}>
      <Box className={classes.section1}>
        <Grid container alignItems="center">
          <Grid item xs>
            <Typography gutterBottom variant="h4">
              Toothbrush
            </Typography>
          </Grid>
          <Grid item>
            <Typography gutterBottom variant="h6">
              $4.50
            </Typography>
          </Grid>
        </Grid>
        <Typography color="textSecondary" variant="body2">
          Pinstriped cornflower blue cotton blouse takes you on a walk to the park or just down the
          hall.
        </Typography>
      </Box>
      <Divider variant="middle" />
      <Box className={classes.section2}>
        <Typography gutterBottom variant="body1">
          Select type
        </Typography>
        <InputLabel id="demo-simple-select-label">Age</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={status}
          onChange={handleChangeSelect}
        >
          <MenuItem value={10}>NOT COMPLETED</MenuItem>
          <MenuItem value={20}>COMPLETED</MenuItem>
        </Select>
      </Box>
      <Box className={classes.section3}>
        <Button color="primary">Add to cart</Button>
      </Box>
    </Box>
  )
}
